script: |
  super -f tsv -I q3556.sql | sort > q3556.out

vector: true

inputs:
  - name: q3556.sql
    data: |
      SELECT DISTINCT tab1.col2 + tab1.col2 / - col0 AS col2 FROM tab1 WHERE NOT - col0 - - col2 IN ( col2 + - col0 * col0 );
  - name: tab1

outputs:
  - name: q3556.out
    data: |
      36
      57
      95
